			_all.Add(template.Id, got);
		}
	}

	public class GameObjectDescription
	{
		public GameObjectDescription(int id, string name, int type, int model)
		{
			Size = 1f;
			Id = id;
			Name = name;
			Type = (byte) type;
			Model = (UInt16) model;
		}


		public GameObjectDescription(int id, string name, int type, int model, uint[] sound)
			: this(id, name, type, model)
		{
			Sound = sound;
		}

		public GameObjectDescription(int id, string name, int type, int model, float size, int flag, uint[] sound)
			: this(id, name, type, model, sound)
		{
			Size = size;
			Flags = flag;
		}

		public GameObjectDescription(int id, string name, int type, int model, float siz, int flag, object loots,
		                             uint[] sound)
			: this(id, name, type, model, siz, flag, sound)
		{
		}

		public int Id { get; private set; }

		public int Flags { get; private set; }

		public int Model { get; private set; }

		public string Name { get; private set; }

		public float Size { get; private set; }

		public uint[] Sound { get; private set; }

		public int Type { get; private set; }


		internal int GetField(int p)
		{
			return (int)(p < Sound.Length ? Sound[p] : 0);
		}
	}

